INSERT INTO `general_info_entries` VALUES ('00f2217b-4427-4008-940b-668f437062c6','Avisos varios','<div>Buenas tardes,</div><div><br></div><div>El jueves 04/12 no habrá anticipos dada la carga administrativa de la preparación de los pagos para el viernes 05/12.</div><div><br></div><div>A partir del 03/12, para que proceda la devolución a los distribuidores por compras hechas a nombre de LA SRL, <b>la factura no deberá indicar otro medio de pago que no sea efectivo</b>. Aquellas facturas que indiquen otro medio (tarjetas, transferencia, etc.) no seran aplicables para las devoluciones.</div><div><br></div><div>Saludos.</div>',15,'Sebastian Cabrera','admin2',NULL,'Avisos varios','2025-12-03 19:19:32','2025-12-03 19:19:32'),('5dea7d06-5f25-4f54-8777-9b698610b8fe','PDF de facturas','Buenas tardes.<div><br></div><div><b>Empezaremos a rechazar los pagos si los distribuidores no mandan el pdf de la factura.</b></div><div><br></div><div>Saludos.</div>',15,'Sebastian Cabrera','admin2',NULL,'PDF de facturas','2025-11-28 19:10:27','2025-11-28 19:10:27'),('853ed688-cc45-4624-b412-a3fc340f9b72','Gerencia','<div>🎯<font size=\"5\"><b>Bono especial de fin de año – Objetivo 308 transportistas</b></font>🚚<br><br><div><font size=\"4\">Hola equipo,</font></div><div><font size=\"4\"><br></font></div><div><font size=\"4\">Queremos compartir una noticia que nos llena de orgullo y, al mismo tiempo, nos propone un lindo desafío para cerrar el año con todo.</font></div><div><font size=\"4\"><br></font></div><div><font size=\"4\">Si como empresa logramos alcanzar los 308 transportistas activos, todos los colaboradores de Logística Argentina SRL que trabajan desde Comercial hasta Administración recibirán un&nbsp;<b>bono extraordinario del 10% de su sueldo</b>.</font></div><div style=\"font-size: x-large; font-weight: bold;\"><br></div><div><div><font size=\"4\">Este bono que es un esfuerzo de la empresa es una forma de agradecerles por el compromiso, la energía y el trabajo que pusieron durante todo el año, y también una motivación extra para dar ese último empujón: contactar a ese cliente que falta, reactivar oportunidades, asesorar y acompañar a nuestros transportistas actuales y seguir trabajando en equipo como lo venimos haciendo.</font></div><div><font size=\"4\">Cada equipo debe dar 10 activos para llegar al objetivo:</font></div><div><div style=\"font-weight: bold;\"><font size=\"4\">&gt; Fidelización 1: 10</font></div><div style=\"font-weight: bold;\"><font size=\"4\">&gt; Fidelización 2: 10</font></div><div style=\"font-weight: bold;\"><font size=\"4\">&gt; Expansión: 10</font></div><div style=\"font-weight: bold; font-size: x-large;\"><br></div><div><div><font size=\"4\">Confiamos plenamente en Ustedes. Sabemos que, si empujamos todos para el mismo lado, el objetivo de los 308 transportistas es totalmente alcanzable.</font></div><div style=\"font-weight: bold; font-size: x-large;\"><br></div></div></div></div></div><div><font size=\"4\">Gracias por cada jornada, cada llamada y cada problema resuelto.</font></div><div><font size=\"4\"><br></font></div><div><div style=\"font-size: large;\"><br></div><div style=\"font-size: large;\">Vamos por ese objetivo y por un cierre de año a la altura del equipo que somos.</div><div style=\"font-size: large;\">Sepan que estoy a su servicio y cuentan con administración y sus encargados para ayudar y servir en lo que necesiten, Beneficios, Plus, Asistencia, etc.</div><div style=\"font-size: large;\"><br></div><div><i><font size=\"5\">Éxitos para Todos!</font></i><font size=\"4\">🤝🚀</font></div><font size=\"4\"><div><i><br></i></div><div><i>Luis Barrios - Gerencia</i></div></font></div>',27,'Super Admin','admin',NULL,'Gerencia','2025-12-11 19:34:52','2025-12-11 19:34:52'),('9064e1a5-db39-42ef-aded-a745be425f35','Plazos para envío de factura','<div>Buenas tardes,</div><div>A partir de diciembre y por cuestiones administrativas, los plazos límites para poder enviar factura pasan de un dia a DOS DIAS HABILES ANTES del día de pago</div><div>EJEMPLO:&nbsp;</div><div>* si pago URBANO el dia 30, habrá tiempo para mandar factura hasta el día 28 (antes era 29)</div><div>* si pago LOGINTER el dia 5, habrá tiempo para mandar factura hasta el dia 3 (antes 4)</div><div>* si pago un dia lunes, no importa la fecha, habrá tiempo hasta el dia jueves inmediato anterior para mandar factura</div><div>repito, esto es asumiendo que las fechas/días sean habiles</div><div><br></div><div>Saludos.</div>',15,'Sebastian Cabrera','admin2',NULL,'Plazos para envío de factura','2025-11-28 21:29:04','2025-11-28 21:29:04'),('e5c6bdf6-ba2c-4ee7-a75f-26e56d31dc19','Sistema de Personal','<strong data-start=\"61\" data-end=\"140\" style=\"color: rgb(36, 42, 229); font-size: xxx-large; background-color: rgb(255, 255, 255);\">Bienvenidos a nuestro sistema de personal de Logística Argentina SRL 🚚🇦🇷</strong><br data-start=\"140\" data-end=\"143\" style=\"color: rgb(36, 42, 229); font-size: xxx-large; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(36, 42, 229); font-size: xxx-large; background-color: rgb(255, 255, 255);\">¡Gracias por formar parte de nuestro equipo! 💼🤝</span>',22,'David Gimenez','admin',NULL,'Sistema de Personal','2025-11-20 12:13:33','2025-11-20 12:13:33'),('ff5123aa-10f0-4f1f-b500-2772bb5de569','Gerencia','<span style=\"background-color: rgb(255, 255, 255);\">📢 🖥️<b>Bien equipoo, oficialmente tuvimos la mejor semana de Logística Argentina!!!</b></span><span style=\"background-color: rgb(255, 255, 255);\">🚀✨</span><br style=\"background-color: rgb(255, 255, 255);\"><br>',27,'Super Admin','admin','data:image/png;base64,','Captura de pantalla 2025-12-19 162807.png','2025-12-19 19:35:01','2025-12-19 19:35:01');
